import React from 'react';

function Auth() {
  return (
    <div className="pt-11 flex flex-col w-2/3 mx-auto">
      <div className="flex flex-row">
        <div className="bg-red-300 w-1/2 h-[55vh] flex justify-center items-center">
          <img
            src="https://media.cntraveler.com/photos/5e73966ddf86d5000910707f/master/w_3987,h_2658,c_limit/George%20Peabody%20Library%20E665TT.jpg"
            alt="library"
            className="p-10"
          />
        </div>
        <div className="bg-green-300 w-1/2 h-[55vh]">
          <div className="flex justify-center items-center bg-blue-400 m-16">
            2
          </div>
        </div>
      </div>
      <div className="bg-yellow-300 h-[35vh]">3</div>
    </div>
  );
}

export default Auth;
